(1, 1, 34, 'Nike Phantom ', 'Nike Phantom GT Club MG', 'Nike Phantom GT Club MG Nike Phantom GT Club MG\r\nNike Phantom GT Club MG Nike Phantom GT Club MG\r\nNike Phantom GT Club MG Nike Phantom GT Club MG\r\nNike Phantom GT Club MG Nike Phantom GT Club MG\r\n', '5800', '43237679620220216_200929.jpg', '185086015720220216_200929.jpg', '200170908120220216_200929.jpg', '184932760720220216_200929.jpg', 1, 50, NULL, '0000-00-00 00:00:00', '', '2022-02-18 12:00:23'),
(2, 1, 31, 'ของฝากหนองคาย', 'ของฝากหนองคาย', 'ของฝากหนองคาย ของฝากหนองคาย ของฝากหนองคาย\r\nของฝากหนองคาย ของฝากหนองคาย ของฝากหนองคาย\r\nของฝากหนองคาย ของฝากหนองคาย ของฝากหนองคาย\r\nของฝากหนองคาย ของฝากหนองคาย ของฝากหนองคาย', '400', '205355192120220216_201259.png', '102272889120220216_201259.png', '74594280320220216_201259.png', '102560396620220216_201259.png', 1, 49, NULL, '0000-00-00 00:00:00', '', '2022-02-18 12:00:10'),
(3, 1, 34, 'ต้นไหลน้ำพี้ ไหล 9 เม็ด', 'ต้นไหลน้ำพี้ ไหล 9 เม็ด', 'รายละเอียดสินค้า ต้นไหลน้ำพี้ ไหล 9 เม็ด\r\n•	สีดำ ช่วยด้านป้องกันอันตราย คุณไสย์มนต์ดำ ภูตผีปีศาจ ลมเพลมพัด \r\nการเดินทางแคล้วคลาดปลอดภัย ล้างอาถรรพ์ สิ่งไม่ดี สีน้ำเงิน/สีฟ้า เสริม\r\nด้านความมั่นคง หน้าที่การงาน การเจรจา การสอบ การเรียน การเเข่งขัน\r\n สีเขียว/เขียวอ่อน ช่วยด้านการค้าขาย ดูดทรัพย์ เงินทองไหลมาเทมา \r\nเสี่ยงโชคเสี่ยงดวง โชคลาภ #ไหลน้ำพี้เป็นธาตุเดียวกับเหล็กไหล \r\n\"ไม่ต้องปลุกเสกก็มีอิทธิฤทธิ์และอำนาจในตัวเอง\" ไหลน้ำพี้ซึ่งเป็\r\nนตระกูลเดียวกับเหล็กไหล พบและหาได้เฉพาะ บ้านน้ำพี้ ตำบลน้ำพี้\r\n จังหวัดอุตรดิตถ์ ไหลน้ำพี้มีความศักดิ์สิทธิ์ในตัว เพียงตั้งจิตอธิฐาน\r\nภาวนาถึงสิ่ง ศักดิ์สิทธิ์ให้ช่วยเหลือให้บังเกิดความสำเร็จ\r\n', '199', '111886805620220216_202831.png', '111699093020220216_202831.png', '37304003720220216_202831.png', '88368881220220216_202831.png', 3, 50, NULL, '0000-00-00 00:00:00', '', '2022-02-18 11:59:10'),
(4, 1, 34, 'โมบายลมกระดิ่งลม ระฆังลม เรียกทรัพย์เสริมฮวงจุ้ย ', 'โมบายลมกระดิ่งลม ระฆังลม เรียกทรัพย์เสริมฮวงจุ้ย แขวนตกแต่งบ้าน ที่ทำงาน ร้านค้า เรียกทรัพย์ปรับราศี', 'รายละเอียดสินค้า โมบายลมกระดิ่งลม ระฆังลม เรียกทรัพย์เสริมฮวงจุ้ย แขวนตกแต่งบ้าน ที่ทำงาน ร้านค้า เรียกทรัพย์ปรับราศี\r\n•	โมบายลมกระดิ่งลมเรียกทรัพย์เสริมฮวงจุ้ย\r\n•	แขวนตกแต่งบ้าน ที่ทำงาน ร้านค้า เรียกทรัพย์ปรับราศีเสริมดวงชะตานกยูง=เป็นสัญลักษณ์ที่สื่อถึงความโชคดี และความเจริญในด้านการเงิน\r\n•	มังกร= มังกรเป็นสัญลักษณ์นำโชคที่ดีต่อธุรกิจ หากนำไว้ที่ทำงานจะบ่งบอกถึงความยิ่งใหญ่ อำนาจ บารมี ความมั่งคั่ง พลานามัยที่สมบูรณ์\r\n•	ม้า =ม้าเป็นสัญลักษณ์ของขุนนาง ชนชั้นสูง และวิถีชีวิตที่สุขสบาย\r\n•	ปลา= ปลาเป็นสัญลักษณ์ของความมั่งคั่ง ความปรารถนาจะได้ผลกำไรหรือประโยชน์จากการทำธุรกิจ\r\n\r\n', '71', '82256241420220216_203003.png', '156802514120220216_203003.png', '182422355520220216_203003.png', '163315394220220216_203003.png', 4, 49, 'kaifaro', '2022-02-16 20:31:12', '', '2022-02-18 11:59:57'),
(5, 1, 31, 'SHARP เตาอบไมโครเวฟ ', 'SHARP เตาอบไมโครเวฟ 22 ลิตร รุ่น R-220 (White)', 'รายละเอียดสินค้า SHARP เตาอบไมโครเวฟ 22 ลิตร รุ่น R-220 (White)\r\n•	ความจุ 22 ลิตร\r\n•	เลือกระดับความร้อนได้ 5 ระดับ\r\n•	แรงดันไฟฟ้า 220 วัตต์\r\n•	ตั้งเวลาในการปรุงอาหารได้ตั้งแต่ 15 วินาที ถึง 30นาที\r\n•	ควบคุมการทำงานด้วยระบบ Jog Dial\r\n', '1990', '2968251420220216_203306.png', '205460130720220216_203306.png', '89153509520220216_203306.png', '154203319220220216_203306.png', 1, 47, NULL, '0000-00-00 00:00:00', '', '2022-02-18 11:59:48'),
(6, 1, 31, 'กระทะ Non Stick ', 'กระทะ Non Stick ขนาด 32 CM. ใช้กับเตาแม่เหล็กไฟฟ้าได้', 'รายละเอียดสินค้า กระทะ Non Stick ขนาด 32 CM. ใช้กับเตาแม่เหล็กไฟฟ้าได้\r\n•	➤ คุณสมบัติ➦ ตัวกระทะผลิตจากเหล็กเคลือบอลูมิเนียม ช่วยให้กระทะแข็งแรง มีความทนทานสูง ป้องกันการบิดเบี้ยว➦ เคลือบด้วยผงเพชร 3 ชั้น ช่วยป้องกันการขูดขีด การเกิดสนิม และการสะสมของเชื้อแบคทีเรีย➦ ขนาด : 32 cm.\r\n', '199', '66837615120220216_203411.png', '129214508920220216_203411.png', '186667578420220216_203411.png', '172654660820220216_203411.png', 3, 46, NULL, '0000-00-00 00:00:00', '', '2022-02-18 11:59:36'),
(7, 1, 34, 'นาฬิกา Casio G - Shock ', 'นาฬิกา Casio G - Shock กีฬากลางแจ้งแฟชั่นกันน้ํา ผู้ชายที่ดู GA-100B-4A ดับเบิล', 'รายละเอียดสินค้า นาฬิกา Casio G - Shock กีฬากลางแจ้งแฟชั่นกันน้ํา ผู้ชายที่ดู GA-100B-4A ดับเบิล\r\n•	Mineral Glass\r\n•	Magnetic Resistant\r\n•	Shock Resistant\r\n•	200-meter water resistance\r\n•	Case / bezel material: Resin\r\n•	Resin Band\r\n', '3999', '87292613520220216_204002.png', '73121901820220216_204002.png', '11372294820220216_204002.png', '162890224220220216_204002.png', 0, 47, NULL, '0000-00-00 00:00:00', '', '2022-02-17 11:22:03');
